import React from 'react';
import axios from 'axios';



export default class Scrape extends React.Component {

    state={imgVdData:[null]};

    async componentDidMount() {

        let data = await axios.get(`http://localhost:3000/scrape`,{headers: {'Authorization': `Basic dGVzdDp0ZXN0MTIz`}});
        console.log(data.data);
        console.log(data.data.data[0]);
        this.setState({ imgVdData:data.data[0] });
    }

    render() {
      return (
        <ul>
          { this.state.imgVdData.map(data => <li>{data}</li>)}
        </ul>
      )
    }
  }
